var $bm_rt;
var pathToTrace = thisComp.layer('horizontal line baixo')('ADBE Root Vectors Group')(1)('ADBE Vectors Group')(1)('ADBE Vector Shape');
var progress = $bm_div(thisLayer.effect('Pseudo/ADBE Trace Path')('Pseudo/ADBE Trace Path-0001'), 100);
var pathTan = pathToTrace.tangentOnPath(progress);
$bm_rt = radiansToDegrees(Math.atan2(pathTan[1], pathTan[0]));

